import styled from "styled-components";
import React from "react";
import Slider from "react-slick";

const ImgSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <Container>
      <Slider {...settings}>
        <Wrap></Wrap>
      </Slider>
    </Container>
  );
};

export default ImgSlider;
const Container = styled.div``;
const Wrap = styled.div``;
